-- ESTRUCTURA GENERADA
CREATE TABLE departamentos (id_departamento INT AUTO_INCREMENT PRIMARY KEY, nombre_departamento VARCHAR(150) NOT NULL UNIQUE);
CREATE TABLE cargos (id_cargo INT AUTO_INCREMENT PRIMARY KEY, nombre_cargo VARCHAR(150) NOT NULL UNIQUE);
CREATE TABLE colaboradores (id_colaborador INT AUTO_INCREMENT PRIMARY KEY, nombre VARCHAR(100), apellido VARCHAR(100), email VARCHAR(150), fecha_ingreso DATE, id_departamento INT, id_cargo INT, foto_ruta VARCHAR(255), FOREIGN KEY (id_departamento) REFERENCES departamentos(id_departamento), FOREIGN KEY (id_cargo) REFERENCES cargos(id_cargo));

